var tipuesearch = {"pages": [{'title': 'About', 'text': 'Stage1-bg2: https://40823234.github.io/stage1-bg2/content/index.html \n \n', 'tags': '', 'url': 'About.html'}, {'title': 'work', 'text': '', 'tags': '', 'url': 'work.html'}, {'title': 'w1', 'text': 'Blog \n LEO是存在Config裡 內容是在Markdown 轉html 後是在blog裡 Ctrl i加新節點 Ctrl r往右 Ctrl l往左 Ctrl u往上 Ctrl d往下 @path是設定路徑 @edit 編輯它只能一層 @clean可以多層 @others可以多層管理 \n 更改使用者和名稱 \n \n local-blog複製指令檢查slug有無相同 \n \n 更改為網站網址 \n \n', 'tags': '', 'url': 'w1.html'}, {'title': 'w2 零件繪製', 'text': '零件檔下載 \n 右夾爪.STL \xa0 \xa0 \xa0 左夾爪.STL \xa0 \xa0 \xa0\xa0 夾爪連桿右.STL \xa0 \xa0\xa0 夾爪連桿左.STL \xa0 \xa0 \xa0 縱向軌道.STL \n 橫向軌道.STL \xa0 \xa0\xa0 本體.STL \xa0 \xa0 \xa0 \xa0 偏心圓.STL \xa0 \xa0 \xa0 \xa0 夾爪連接桿.STL \xa0 \xa0 \xa0\xa0 連桿.STL \n \n \n', 'tags': '', 'url': 'w2 零件繪製.html'}, {'title': 'w3 CoppeliaSim 模擬', 'text': '\n \n \n 模擬教學 \n \xa0 \n \n 1.點選file>Import>Mesh選取零件> Up-vector可選取零件擺放之座標>ResizableFloor_5_25點兩下可以調整地板大小 \n \n 2.畫面點右鍵畫面點右鍵>Add>Joint可選擇要加Revolute(旋轉軸)或Prismatic(矩形軸) \n \n 3.將自己零件造作動方式排列順序>旋轉軸點兩下視窗Show dynamic properties鈕點下去勾選Motor enabled可以啟動馬達>零件點選兩下點視窗 Show dynamic properties鈕>會移動的零件都要點Body is dynamic>Body is respondable 指是否實體化 ,若兩個實體化物件互相碰撞 ,會依照物理設定做相對反應。 \n \n \n', 'tags': '', 'url': 'w3 CoppeliaSim 模擬.html'}, {'title': 'w4', 'text': 'w4內容介紹 \n \n \n', 'tags': '', 'url': 'w4.html'}, {'title': '問題與解決方法', 'text': '第一次設計: \n \n 經過討論後決的第一次設計出的夾爪只能抓取前方固定範圍距離的物品靈活度太低 \n \n 第二次設計改良: \n \n \n 討論後決定增加橫向軌道與縱向軌道來增加可抓取範圍以增加靈活度增加可抓取範圍 \n \n 第三次設計改良: \n \n \n 加入軌道後發現橫向軌道有傾斜問題導致夾抓無法移動到指定位置 \n \n 第四次設計改良: \n \n \n 為解決橫向傾斜問題我們增加了縱向軌道的寬度來支撐 \n \n', 'tags': '', 'url': '問題與解決方法.html'}, {'title': 'W5', 'text': '\n \n \n \n \n', 'tags': '', 'url': 'W5.html'}]};